import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder selector
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Focus and type 'iPh' to trigger autocomplete
    const searchInput = await page.$('input[placeholder="Search Amazon"]');
    await searchInput.click();
    await searchInput.type('iPh');

    // Wait for suggestions box using its class (created dynamically)
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of suggestions visible
    const step2 = path.join(screenshotsDir, 'step_2_suggestions.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract suggestion texts
    const suggestionItems = await page.$$eval('.search-suggestions .suggestion-item', nodes =>
      nodes.map(n => n.textContent.trim())
    );

    // Click the first suggestion if available
    let clickedSuggestion = null;
    if (suggestionItems.length > 0) {
      clickedSuggestion = suggestionItems[0];
      await page.click(`.search-suggestions .suggestion-item:text("${clickedSuggestion}")`).catch(async () => {
        // Fallback: click the first suggestion by index if :text() is not supported
        const firstSuggestion = await page.$('.search-suggestions .suggestion-item');
        if (firstSuggestion) await firstSuggestion.click();
      });
    }

    // Wait for main content area to update (search results)
    await page.waitForSelector('#mainContent', { timeout: 5000 });

    // Take screenshot of search results
    const step3 = path.join(screenshotsDir, 'step_3_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the search results count text
    let resultsCount = '';
    try {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    } catch (e) {
      resultsCount = '';
    }

    // Extract the first product title in results (if any)
    let firstProductTitle = '';
    try {
      firstProductTitle = await page.$eval('.product-title', el => el.textContent.trim());
    } catch (e) {
      firstProductTitle = '';
    }

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected a suggestion, and verified search results.",
      extractedData: {
        suggestions: suggestionItems,
        clickedSuggestion,
        resultsCount,
        firstProductTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
